function appender(n,a){var c=[].concat.apply([],n),e=[].concat.apply([],a);c.length!==e.length&&$(".content").append('<div class="warning">Warning, Arrays are not the same length</div>'),$.each(c,function(n,a){a.CODE!==e[n].CODE&&$(".description").append('<div class="notSame">'+a.CODE+"|"+e[n].CODE+"</div>")}),$.each(c,function(n,a){a.DESCRIPTION!==e[n].DESCRIPTION&&$(".description").append('<div class="notSame">'+a.DESCRIPTION+"|"+e[n].DESCRIPTION+"</div>")})}var csv1=[],csv2=[];$(document).ready(function(){$.getJSON("xml/majorsFromxml.json",function(n){csv1.push(n),$.getJSON("xml/majors.json",function(n){csv2.push(n),appender(csv1,csv2)})})});